GRIYA KOST HINDUN
(BUKAN KOST BEBAS YA)

Kost dengan konsep studio apartment dan hanya 5 kamar dengan fasilitas kamar mandi hingga dapur berada di dalam tiap kamar masing-masing sehingga lebih private.

Estimasi jarak kost dengan tujuan:
1. BIN 3 Menit;
2. St. Pasar Minggu Baru 5 Menit;
3. St. Pasar Minggu Lama 10 Menit;
4. Kalibata Mall 10 Menit;
5. Busway Kalibata 10 Menit;
6. RS. Brawijaya Duren Tiga 10 Menit;
7. RSUD Budhi Asih 10 Menit;
8. Pancoran 15 Menit;
9. Kuningan 20 Menit;
10. Bandara Halim Perdana Kusuma 20 Menit;
11. Sudirman 20 Menit (dengan menggunakan kereta)

Fasilitas:
1. Depan kost mesjid besar;
2. Kamar mandi dalam;
3. Dapur didalam kamar masing-masing (Disertai dengan kompor,gas (tabung gas disediakan tapi gas diisi masing" penghuni) dan wastafel) ;
4.Lemari;
5. AC; 
6. Kasur size 90
7. GRATIS mie instan, snacks/roti Aoka, Kopi/Teh, air minum galon dengan dispenser Hot & Normal yang kami sediakan di lorong untuk Penghuni;
8. FREE WIFI dan air;
9. Dilengkapi CCTV 24 jam full motion sensor;
10. Parkiran hanya untuk Motor saja;
11. Rooftop balkon bersama dan ruang jemur;
12. Mesin cuci dan Setrika baju dipinjamkan untuk dipakai bersama/sharing;
13. Kulkas bersama;
14. Rak sepatu, tempat sampah, keset sudah tersedia di dalam kamar masing-masing;
15. Akses jalan depan kos lebar dilalui 2 mobil papasan;
16. Listrik menggunakan token dalam kamar masing-masing yang dibayar oleh Penghuni.

Harga
1. Kamar kecil 1550 Nett size kasur 90

Kos campur
Dilarang membawa hewan

